import { GET_ERRORS } from "../actions/type";

const initialState={
    errors: "This is State on error reduser",
}

export default function errorReducer(state= initialState, action){
    switch(action.type){
        case GET_ERRORS:
        return action.payload;
    default:
        return state;
    }
}
